def algo(ram, hdd, cpu, gpu, os_ver, digits=6):
    try:
        ram = int(ram)
        hdd = int(hdd)
        cpu = int(cpu)
        gpu = int(gpu)
        os_ver = int(os_ver)
    except ValueError:
        print("Failed to convert to int")
    
    before0 = ram * gpu
    before1 = 3/4 * hdd/before0
    before2 = cpu + os_ver
    before3 = (ram**3 + before1) / 3
    before4 = before3 * before2
    after = before4**3
    final = after**(1/3)
    final = f"{final}".replace(".", "")

    if len(final) <= digits:
        final = final + str()
    
    final = final[:digits]
        
    return final